Компания CADENT выпустила аппарат под названием iTero для внутриротового сканирования зубов. Этот внутриротовой сканер работает по технологии CAD/CAM, что дает его абсолютное совмещение с техническими фрезерными станками, работающими по цифровым технологиям. Это революционное решение позволяет добиться максимальных результатов в ортопедической стоматологии как на этапе планирования конструкции, ее изготовления, так и в конечном результате в ротовой полости.
Для корректности дальнейшего повествования, введем термин «цифровые оттиски». Цифровые оттиски, в отличие от традиционных, - это прямое отображение поверхности твёрдых и мягких тканей, расположенных на протезном ложе и его границах. 

Преимущества технологии iTero:

Для стоматологов:

-        Визуализация на экране позволяет оперативно производить корректировки для получения идеального оттиска с первой же процедуры;
-        Возможность визуальной оценки качества препарированной поверхности (достаточно места, оптимальная соосность обработанных зубов), доработки  и исправления в процессе сканирования;
-        Отсутствие затрат на стерилизацию оттиска, покупку оттискных ложек, оттискного материала;
-        Отсутствие искажений при снятии оттиска;
-        Не нужно убирать остатки слепочного материала;

Для пациентов:

-        Процедура «снятия оттиска» проходит комфортнее;
-        Меньше времени в стоматологическом кресле;
-        Меньше повторных приемов у стоматолога;
-        Протезы, которые подходят Вам идеально;
-        Исключается повторный прием для переснятия, дорабатывния зубов. Как следствие экономия времени пациента;

Для зуботехнических лабораторий:

-        Максимально точные слепки гарантируют возможность создания протеза высшего качества;
-        Увеличение продуктивности за счет снижения необходимости делать дорогостоящие повторные работы;
-        Экономия денег и времени на закупку гипса, пинов;
-        Отсутствие затрат на зарплату человека, изготавливающего гипсовые модели.
